    hoteli: [
        {id:'1', naziv: 'w', adresa: 'w', opis: 'w'},
        {id:'2', naziv: 'b', adresa: 'b', opis: 'b'},
        {id:'3', naziv: 'e', adresa: 'e', opis: 'e'}
    ]
}

const hoteliReducer = (state = initState, action) => {
    return state
}

export default hoteliReducer;
